function MyButton(){
return(
<div>
    <button type="button" class="btn btn-danger">PRESS TO EXPLOIT FEAR</button>
</div>
)
}

function UserEntry(){
    return(
        <div>
            <label>Email address:</label>
            <input type="email" placeholder="Enter email..."/>
        </div>
    )
}
export default function App(){
    return(
        <div>
            <UserEntry/>
            <br />
            <MyButton/>
        </div>
    )
}
